{"cells":[{"source":"<a href=\"https://www.kaggle.com/taylorstringe/bellabeat-case-study?scriptVersionId=87389826\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"feeaf2ca","metadata":{"papermill":{"duration":0.179867,"end_time":"2022-02-09T13:16:07.972086","exception":false,"start_time":"2022-02-09T13:16:07.792219","status":"completed"},"tags":[]},"source":["![](https://bookface-images.s3.amazonaws.com/logos/d69e3b90f5cd0c8528283d84e3b6e87097c94302.png)\n","\n","# <span style=\"color:#bf5039\"> Table of Contents </span>\n","\n","* [1. Summary](#summary_1)\n","    * [1.1 Stakeholders](#summary_1_1)\n","    * [1.2 Products](#summary_1_2)\n","* [2. Ask Phase](#ask_phase_2)\n","    * [2.1 Guiding Questions](#ask_phase_2_1)\n","* [3. Prepare Phase](#prepare_phase_3)\n","    * [3.1 Dataset](#dataset_3_1)\n","    * [3.2 Accessibility and privacy](#accessibility_and_privacy_3_2)\n","    * [3.3 Data organization and verification](#data_organization_and_verification_3_3)\n","    * [3.4 Data credibility and integrity](#data_credibility_and_integrity_3_4)\n","* [4. Process Phase](#process_phase_4)\n","    * [4.1 Installing packages and opening libraries](#installing_packages_and_opening_libraries_4_1)\n","    * [4.2 Importing datasets](#importing_datasets_4_2)\n","    * [4.3 Previewing datasets](#previewing_datasets_4_3)\n","    * [4.4 Cleaning and formatting](#cleaning_and_formatting_4_4)\n","        * [4.4.1 Check and remove duplicates](#check_and_remove_duplicates_4_4_1)\n","        * [4.4.2 verify distinct users](#verify_distinct_users_4_4_2)\n","        * [4.4.3 Cleaning renaming and formatting columns](#cleaning_renaming_and_formatting_columns_4_4_3)\n","        * [4.4.4 Merging dataframes](#merging_data_frames_4_4_4)\n","* [5. Analyze and Share Phase](#5)\n","    * [5.1 Analyzing step and sleep usage](#5_1)\n","        * [5.1.1 Step usage](#5_1_1)\n","        * [5.1.2 Sleep usage](#5_1_2)\n","        * [5.1.3 Step and sleep usages directly compared](#5_1_3)\n","    * [5.2 Analyzing steps and sleep usage by weekday](#5_2)\n","    * [5.3 Analyzing steps and sleep totals by weekday](#5_3)\n","    * [5.4 Analyzing step achievement levels](#5_4)\n","    * [5.5 Analyzing how much of the day users wear devices](#5_5)\n","        * [5.5.1 Investigating if partial day users do not wear device for sleep](#5_5_1)\n","    * [5.6 Analyzing what times of the day users are active](#5_6)\n","* [6. Conclusion and Recommendations](#conclusion)"]},{"cell_type":"markdown","id":"4ce8c004","metadata":{"papermill":{"duration":0.179301,"end_time":"2022-02-09T13:16:08.332273","exception":false,"start_time":"2022-02-09T13:16:08.152972","status":"completed"},"tags":[]},"source":["# <span style=\"color:#bf5039\"> 1. Summary </span> <a class=\"anchor\" id=\"summary_1\"></a>\n","\n","In this case study I am playing the role of Junior Data Analyst for Bellabeat, a company that develops wearables and accompanying products that monitor biometric and lifestyle data to help women make healthy choices.\n","\n","I have been asked to analyze smart device data from one of Bellabeat's products and provide insight into how customers are using their devices. The purpose of my analysis is to guide marketing strategy for the company. My analysis will be presented to the Bellabeat executive team.\n","\n","### 1.1 Stakeholders <a class=\"anchor\" id=\"summary_1_1\"></a>\n","\n","* Urška Sršen: Bellabeat’s cofounder and Chief Creative Officer\n","* Sando Mur: Mathematician and Bellabeat’s cofounder; key member of the Bellabeat executive team\n","* Bellabeat marketing analytics team: A team of data analysts responsible for collecting, analyzing, and reporting data that helps guide Bellabeat’s marketing strategy.\n","\n","\n","### 1.2 Products <a class=\"anchor\" id=\"summary_1_2\"></a>\n","\n","* Bellabeat app: The Bellabeat app provides users with health data related to their activity, sleep, stress, menstrual cycle, and mindfulness habits. This data can help users better understand their current habits and make healthy decisions. The Bellabeat app connects to their line of smart wellness products.\n","\n","* Leaf: Bellabeat’s classic wellness tracker can be worn as a bracelet, necklace, or clip. The Leaf tracker connects to the Bellabeat app to track activity, sleep, and stress.\n","\n","* Time: This wellness watch combines the timeless look of a classic timepiece with smart technology to track user activity, sleep, and stress. The Time watch connects to the Bellabeat app to provide you with insights into your daily wellness.\n","\n","* Spring: This is a water bottle that tracks daily water intake using smart technology to ensure that you are appropriately hydrated throughout the day. The Spring bottle connects to the Bellabeat app to track your hydration levels.\n","\n","* Bellabeat membership: Bellabeat also offers a subscription-based membership program for users. Membership gives users 24/7 access to fully personalized guidance on nutrition, activity, sleep, health, beauty, and mindfulness based on their lifestyle and goals."]},{"cell_type":"markdown","id":"26a23003","metadata":{"papermill":{"duration":0.178139,"end_time":"2022-02-09T13:16:08.68772","exception":false,"start_time":"2022-02-09T13:16:08.509581","status":"completed"},"tags":[]},"source":["# <span style=\"color:#bf5039\"> 2. Ask Phase </span> <a class=\"anchor\" id=\"ask_phase_2\"></a>"]},{"cell_type":"markdown","id":"c2e74c32","metadata":{"papermill":{"duration":0.182782,"end_time":"2022-02-09T13:16:09.047068","exception":false,"start_time":"2022-02-09T13:16:08.864286","status":"completed"},"tags":[]},"source":["### 2.1 Guiding Questions <a class=\"anchor\" id=\"ask_phase_2_1\"></a>\n","\n","I have been asked to guide my analysis with the following questions:\n","\n","#### 1. What are some trends in smart device usage?\n","\n","#### 2. How could these trends apply to Bellabeat customers?\n","\n","#### 3. How could these trends help influence Bellabeat marketing strategy?"]},{"cell_type":"markdown","id":"a3bd3dc5","metadata":{"papermill":{"duration":0.176158,"end_time":"2022-02-09T13:16:09.403388","exception":false,"start_time":"2022-02-09T13:16:09.22723","status":"completed"},"tags":[]},"source":["# <span style=\"color:#bf5039\"> 3. Prepare Phase </span> <a class=\"anchor\" id=\"prepare_phase_3\"></a>\n","\n","### 3.1 Dataset <a class=\"anchor\" id=\"dataset_3_1\"></a>\n","\n","The data source for the case study is FitBit Fitness Tracker Data. It was made available through Mobius and stored in Kaggle.\n","\n","This dataset was generated by respondents to a distributed survey via Amazon Mechanical Turk between 03.12.2016-05.12.2016. Thirty eligible Fitbit users consented to the submission of personal tracker data, including minute-level output for physical activity, heart rate, and sleep monitoring. Individual reports can be parsed by export session ID (column A) or timestamp (column B). Variation between output represents use of different types of Fitbit trackers and individual tracking behaviors / preferences.\n","\n","### 3.2 Accessibility and privacy <a class=\"anchor\" id=\"accessibility_and_privacy_3_2\"></a>\n","\n","The owner has dedicated the work to the public domain by waiving all of his or her rights to the work worldwide under copyright law, including all related and neighboring rights, to the extent allowed by law. You can copy, modify, distribute and perform the work, even for commercial purposes, all without asking permission. See Other Information below.\n","\n","### 3.3 Data organization and verification <a class=\"anchor\" id=\"data_organization_and_verification_3_3\"></a>\n","\n","The data is available as 18 csv files, each containing different data. Entries record a unique ID, date/time, and quantitavie health data. The length of time within the dataset is 31 days from 4/12/2016 to 5/9/2016.\n","\n","\n","| Table Name | Type | Description |\n","| --- | --- | --- |\n","| dailyActivity_merged | Microsoft Excel CSV | Daily Activity over 31 days of 33 users. Tracking daily: Steps, Distance, Intensities, Calories |\n","|dailyCalories_merged | Microsoft Excel CSV | Daily Calories over 31  days of 33 users |\n","| dailyIntensities_merged | Microsoft Excel CSV | Daily Intensity over 31 days of 33 users. Measured in Minutes and Distance, dividing groups in 4 categories: Sedentary, Lightly Active, Fairly Active,Very Active |\n","| dailySteps_merged | Microsoft Excel CSV | Daily Steps over 31 days of 33 users | \n","| heartrate_seconds_merged | Microsoft Excel CSV | Exact day and time heartrate logs for just 7 users |\n","| hourlyCalories_merged | Microsoft Excel CSV | Hourly Calories burned over 31 days of 33 users |\n","| hourlyIntensities_merged | Microsoft Excel CSV | Hourly total and average intensity over 31 days of 33 users |\n","| hourlySteps_merged | Microsoft Excel CSV | Hourly Steps over 31 days of 33 users |\n","| minuteCaloriesNarrow_merged | Microsoft Excel CSV | Calories burned every minute over 31 days of 33 users (Every minute in single row)|\n","| minuteCaloriesWide_merged | Microsoft Excel CSV | Calories burned every minute over 31 days of 33 users (Every minute in single column)|\n","| minuteIntensitiesNarrow_merged | Microsoft Excel CSV | Intensity counted by minute over 31 days of 33 users (Every minute in single row) |\n","| minuteIntensitiesWide_merged | Microsoft Excel CSV | Intensity counted by minute over 31 days of 33 users (Every minute in single column)|\n","| minuteMETsNarrow_merged | Microsoft Excel CSV | Ratio of the energy you are using in a physical activity compared to the energy you would use at rest. Counted in minutes |\n","| minuteSleep_merged | Microsoft Excel CSV | Log Sleep by Minute for 24 users over 31 days. Value column not specified |\n","| minuteStepsNarrow_merged | Microsoft Excel CSV | Steps tracked every minute over 31 days of 33 users (Every minute in single row)|\n","| minuteStepsWide_merged | Microsoft Excel CSV | Steps tracked every minute over 31 days of 33 users (Every minute in single column) |\n","| sleepDay_merged | Microsoft Excel CSV| Daily sleep logs, tracked by: Total count of sleeps a day, Total minutes, Total Time in Bed |\n","| weightLogInfo_merged | Microsoft Excel CSV | Weight track by day in Kg and Pounds over 30 days. Calculation of BMI.5 users report weight manually 3 users not.In total there are 8 users |\n","\n","### 3.4 Data credibiliity and integrity <a class=\"anchor\" id=\"data_credibility_and_integrity_3_4\"></a>\n","\n","The data is limited and prone to sampling bias due to the sample size of 33 users and no demographic data. Additionally, the data is 5 years old and only collected from a limited time frame of 31 days."]},{"cell_type":"markdown","id":"bf9a8529","metadata":{"papermill":{"duration":0.176777,"end_time":"2022-02-09T13:16:09.756365","exception":false,"start_time":"2022-02-09T13:16:09.579588","status":"completed"},"tags":[]},"source":["# <span style=\"color:#bf5039\"> 4. Process Phase </span> <a class=\"anchor\" id=\"process_phase_4\"></a>\n","\n","I will be performing my analysis using R due to the size of the data files and to create visualizations.\n","\n","### 4.1 Installing packages and opening libraries <a class=\"anchor\" id=\"installing_packages_and_opening_libraries_4_1\"></a>\n","\n","The following libraries will be needed for data cleaning and visualizing.\n","\n","* tidyverse\n","* ggpubr\n","* janitor\n","* waffle"]},{"cell_type":"code","execution_count":1,"id":"2065b7da","metadata":{"_kg_hide-input":true,"execution":{"iopub.execute_input":"2022-02-09T13:16:10.122518Z","iopub.status.busy":"2022-02-09T13:16:10.119642Z","iopub.status.idle":"2022-02-09T13:16:12.049161Z","shell.execute_reply":"2022-02-09T13:16:12.047831Z"},"papermill":{"duration":2.11