.2618772 26.19%      \n","2 Lightly Active 171   0.1981460 19.81%      \n","3 Fairly Active  163   0.1888760 18.89%      \n","4 Very Active    303   0.3511008 35.11%      "]},"metadata":{},"output_type":"display_data"}],"source":["step_categories <- daily_activity %>%\n","    filter(totalsteps != 0) %>% #don't include days the device was not used\n","    mutate(activity_level = case_when(\n","        totalsteps < 5000 ~ 'Sedentary',\n","        totalsteps >= 5000 & totalsteps <=7499 ~ 'Lightly Active',\n","        totalsteps >= 7500 & totalsteps <=9999 ~ 'Fairly Active',\n","        totalsteps >= 1000 ~ 'Very Active',)) %>%\n","    select(id, totalsteps, activity_level)\n","\n","step_category_distribution <- step_categories %>%\n","    group_by(activity_level) %>%\n","    summarize(total = n()) %>%\n","    mutate(percent = total / sum(total)) %>%\n","    mutate(chart_labels = scales::percent(percent))\n","\n","step_category_distribution$activity_level <-ordered(step_category_distribution$activity_level, levels=c(\"Sedentary\", \"Lightly Active\", \"Fairly Active\", \"Very Active\"))\n","step_category_distribution <- step_category_distribution %>%\n","    arrange(activity_level)\n","\n","step_category_distribution"]},{"cell_type":"code","execution_count":21,"id":"834b8f24","metadata":{"execution":{"iopub.execute_input":"2022-02-09T13:16:40.303182Z","iopub.status.busy":"2022-02-09T13:16:40.300682Z","iopub.status.idle":"2022-02-09T13:16:40.629101Z","shell.execute_reply":"2022-02-09T13:16:40.627979Z"},"papermill":{"duration":0.59121,"end_time":"2022-02-09T13:16:40.629253","exception":false,"start_time":"2022-02-09T13:16:40.038043","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd3xT9f/F8XfSvUuZskfZS4aIgiBDEQduwYUo7r3160/FLe69xQEiyCyyZRSU\nPctqCwUKtHTTlSbNvr8/0pYC3bS96c3r+eCP9OZzb87Npe3pXdEpiiIAAABo+PRqBwAAAEDt\noNgBAABoBMUOAABAIyh2AAAAGkGxAwAA0AiKHQAAgEZQ7AAAADSCYgcAA