ill":{"duration":0.338311,"end_time":"2022-02-09T13:16:46.452509","exception":false,"start_time":"2022-02-09T13:16:46.114198","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 2 × 3</caption>\n","<thead>\n","\t<tr><th scope=col>no_sleep_use</th><th scope=col>no_sleep_users</th><th scope=col>percent</th></tr>\n","\t<tr><th scope=col>&lt;lgl&gt;</th><th scope=col>&lt;int&gt;</th><th scope=col>&lt;chr&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>FALSE</td><td>333</td><td>96%</td></tr>\n","\t<tr><td> TRUE</td><td> 14</td><td>4% </td></tr>\n","</tbody>\n","</table>\n"],"text/latex":["A tibble: 2 × 3\n","\\begin{tabular}{lll}\n"," no\\_sleep\\_use & no\\_sleep\\_users & percent\\\\\n"," <lgl> & <int> & <chr>\\\\\n","\\hline\n","\t FALSE & 333 & 96\\%\\\\\n","\t  TRUE &  14 & 4\\% \\\\\n","\\end{tabular}\n"],"text/markdown":["\n","A tibble: 2 × 3\n","\n","| no_sleep_use &lt;lgl&gt; | no_sleep_users &lt;int&gt; | percent &lt;chr&gt; |\n","|---|---|---|\n","| FALSE | 333 | 96% |\n","|  TRUE |  14 | 4%  |\n","\n"],"text/plain":["  no_sleep_use no_sleep_users percent\n","1 FALSE        333            96%    \n","2  TRUE         14            4%     "]},"metadata":{},"output_type":"display_data"}],"source":["time_worn_and_sleep <- merge(time_worn_stats, sleep_day, by=c('id', 'date'), all.x=TRUE)\n","\n","partial_users_sleep <- time_worn_and_sleep %>%\n","    filter(category == '12 to 18 Hours')\n","\n","no_sleep_use <- partial_users_sleep %>%\n","    mutate(no_sleep_use = is.na(total_minutes_asleep)) %>%\n","    group_by(no_sleep_use) %>%\n","    summarize(no_sleep_users = n()) %>%\n","    mutate(percent = no_sleep_users / sum(no_sleep_users)) %>%\n","    mutate(percent = scales::percent(percent))\n","\n","no_sleep_use"]},{"cell_type":"markdown","id":"e91b9510","metadata":{"papermill":{"duration":0.286599,"end_time":"2022-02-09T13:16:47.023208","exception":false,"start_time":"2022-02-09T13:16:46.736609","status":"completed"},"tags":[]},"source":["We can see that most of the time (96%) users wear the device for 12 to 18 hours in a day, they do wear the device for sleeping, so taking the device off for sleep does not appear to be a reason for users not wearing the device a full 24 hours in a day."]},{"cell_type":"markdown","id":"29c34234","metadata":{"papermill":{"duration":0.266784,"end_time":"2022-02-09T13:16:47.566811","exception":false,"start_time":"2022-02-09T13:16:47.300027","status":"completed"},"tags":[]},"source":["### 5.6 Analyzing what times of the day users are active <a class=\"anchor\" id=\"5_6\"></a>"]},{"cell_type":"markdown","id":"35b63785","metadata":{"papermill":{"duration":0.283278,"end_time":"2022-02-09T13:16:48.132245","exception":false,"start_time":"2022-02-09T13:16:47.848967","status":"completed"},"tags":[]},"source":["To analyze what times throughout the day users are active, I will group the hourly steps data by time, calculate the average steps for those times, and visualize the distribution with a bar chart."]},{"cell_type":"code","execution_count":26,"id":"b26db3ce","metadata":{"execution":{"iopub.execute_input":"2022-02-09T13:16:48.679546Z","iopub.status.busy":"2022-02-09T13:16:48.677918Z","iopub.status.idle":"2022-02-09T13:16:48.706535Z","shell.execute_reply":"2022-02-09T13:16:48.705041Z"},"papermill":{"duration":0.30154,"end_time":"2022-02-09T13:16:48.706706","exception":false,"start_time":"2022-02-09T13:16:48.405166","status":"completed"},"tags":[]},"outputs":[],"source":["avg_steps_by_time <- hourly_steps %>%\n","    group_by(time) %>%\n","    summarize(steps = mean(step_total))"]},{"cell_type":"code","execution_count":27,"id":"23708d4e","metadata":{"execution":{"iopub.execute_input":"2022-02-09T13:16:49.2821Z","iopub.status.busy":"2022-02-09T13:16:49.280346Z","iopub.status.idle":"2022-02-09T13:16:49.574887Z","shell.execute_reply":"2022-02-09T13:16:49.574228Z"},"papermill":{"duration":0.599108,"end_time":"2022-02-09T13:16:49.575029"