e Bellabeat marketing strategy?**\n","\n","\n","I make the following recommendations to the stakeholders:\n","\n","### 1. Sleep Rewards\n","\n","**Description:** Encourage and promote the functionality of the devices as sleep tracking tools. Offer redeemable points for reaching sleep goals.\n","\n","**Rationale:** **Only 50%** of users were highly active with the device for tracking sleep, but we know that there is greater potential based on **nearly 88%** of users being highly active with the device for tracking steps. \n","\n","|**Recommendation**| **Description** | **Rationale** |\n","|---| ---|---|\n","|**1. Sleep Rewards**| Encourage and promote the functionality of the devices as sleep tracking tools. Offer redeemable points for reaching sleep goals.| **Only 50%** of users were highly active with the device for tracking sleep, but we know that there is greater potential based on **nearly 88%** of users being highly active with the device for tracking steps. |\n","|**2. Social Media Competitions**| Use social media to increase user usage for Friday through Monday. Consider hosting step competitions on social media to increase usage on the weekend.| The analysis shows that users use their devices **most in the middle of the week on Tuesday through Thursdays** and least on the ends of the work week Friday through Monday. |\n","|**3. Maintain and Grow Activity Tracking Base** | Hang on to and grow the customer base that uses the device as an activity tracking tool. Consider ways to grow the user pool from this base by offering referral rewards.| Users of **all daily step counts** are using the device and are **highly active** with it. Right now, the devices are favored for **activity tracking**.\n","\n"]},{"cell_type":"markdown","id":"c7963d1c","metadata":{"papermill":{"duration":0.272613,"end_time":"2022-02-09T13:16:51.749968","exception":false,"start_time":"2022-02-09T13:16:51.477355","status":"completed"},"tags":[]},"source":["Based on the analysis and with the 3 guiding questions in mind:\n","\n","**1. What are some trends in smart device usage?**\n","\n","**2. How could these trends apply to Bellabeat customers?**\n","\n","**3. How could these trends help influence Bellabeat marketing strategy?**\n","\n","\n","I make the following recommendations to the stakeholders:\n","\n","### 1. Sleep Rewards\n","\n","**Description:** Encourage and promote the functionality of the devices as sleep tracking tools. Offer redeemable points for reaching sleep goals.\n","\n","**Rationale:** **Only 50%** of users were highly active with the device for tracking sleep, but we know that there is greater potential based on **nearly 88%** of users being highly active with the device for tracking steps."]},{"cell_type":"code","execution_count":28,"id":"16b89ee8","metadata":{"_kg_hide-input":true,"execution":{"iopub.execute_input":"2022-02-09T13:16:52.307027Z","iopub.status.busy":"2022-02-09T13:16:52.305205Z","iopub.status.idle":"2022-02-09T13:16:52.878623Z","shell.execute_reply":"2022-02-09T13:16:52.877972Z"},"papermill":{"duration":0.850971,"end_time":"2022-02-09T13:16:52.878757","exception":false,"start_time":"2022-02-09T13:16:52.027786","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzddWAT9//H8XdSd6MFBhRrobg7Y7hvwLDisg0dDIZNgCETYPgYg+EwrMB+bAyZ\nFIcvY9iw4lJchlVoKsnvj2tDKQUKNE374fn4K1wud+9rLm9eyX3uTmcymQQAAABZn97aBQAA\nACB9EOwAAAAUQbADAABQBMEOAABAEQQ7AAAARRDsAAAAFEGwAwAAUATBDgAAQBEEOwAAAEUQ\n7AAAABRBsAMAAFAEwQ4AAEARBDsAAABFEOwAAAAUQbADAABQBMEOAABAEQQ7AAAARRDsAAAA\nFEGwAwAAUATBDgAAQBEEOwAAAEUQ7AAAABRBsAMAAFAEwQ4AAEARBDsAAABFEOwAAAAUQbAD\nAABQBMEOAABAEQQ7AAAARRDsAAAAFEGwAwAAUATBDgAAQBEEOwAAAEUQ7AAAABRBsAMAAFAE\nwQ4AAEARBDsAAABFEOwAAAAUQbADAABQBMEOAABAEQQ7AAAARRDsAAAAFEGwAwAAUATBDgAA\nQBEEOwAAAEUQ7AAAABRBsAMAAFAEwQ4AAEARBDsAAABFEOwAAAAUQbADAABQBMEOAABAEQQ7\nAAAARRDsAAAAFEGwAwAAUATBDgAAQBEEOwAAAEUQ7AAAABRBsAMAAFAEwQ4AAEARBDsAAABF\nEOwAAAAUQbADAA