*| Use social media to increase user usage for Friday through Monday. Consider hosting step competitions on social media to increase usage on the weekend.| The analysis shows that users use their devices **most in the middle of the week on Tuesday through Thursdays** and least on the ends of the work week Friday through Monday. |\n","|**3. Maintain and Grow Activity Tracking Base** | Hang on to and grow the customer base that uses the device as an activity tracking tool. Consider ways to grow the user pool from this base by offering referral rewards.| Users of **all daily step counts** are using the device and are **highly active** with it. Right now, the devices are favored for **activity tracking**."]},{"cell_type":"code","execution_count":29,"id":"965daa18","metadata":{"_kg_hide-input":true,"execution":{"iopub.execute_input":"2022-02-09T13:16:53.987422Z","iopub.status.busy":"2022-02-09T13:16:53.985799Z","iopub.status.idle":"2022-02-09T13:16:54.437344Z","shell.execute_reply":"2022-02-09T13:16:54.436704Z"},"papermill":{"duration":0.728664,"end_time":"2022-02-09T13:16:54.437493","exception":false,"start_time":"2022-02-09T13:16:53.708829","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd3xT9f7H8c/JbNJ0Q4GW3bJn2RsEERFx42Y47+Ve9CKiwA9xgBMRrwtFr4oD\nxS2oKCoIyFC2KHsIhbJL905yfn+khDZdgaZNevp6/sGj+eabbz45NN++c3LO9yiqqgoAAABq\nPp2/CwAAAIBvEOwAAAA0gmAHAACgEQQ7AAAAjSDYAQAAaATBDgAAQCMIdgAAABpBsAMAANAI\njQQ7pQSD2RbbrNV1dz30zfbkKnrSzdM6K4oyfNWxKhrfrSBrq+tFldVh9S0tFEXpPG1zVVci\nItknfrljSNc6NlO9dv9Xdc/iyE18+5lJQ/t0rBsRajSYQqNiug66asYrn6Y5An097ftiQxRF\n2Z1j9+2wh7+9XFEUo7WFs8Rdv45pqSiK0RqfX2LbrB/fVlGU0EaTfVuMiLzbKkpRlI9OZ1/o\nA1+Mi1AUZWlKrs9L0hjmtNo5p21/rruiKEMWH6q6Si4C01r5Am1a00iwc2kUF+9WP9x88vC+\nr96Zc3VC7G3Pr/B3adrxWP/rFqzYYmzV//IBLaroKTITv+vVuPXd//fi8t/3GMNjunbr3DDM\nuXX1t0/ef1OTNldvTM9391SdWWvXrv1905EqqiRw1OszQUTsOfu/OJPjcde8H5JExJ5z4NVj\nmR53fb80SUQaXzuqWmqE7zGnVYOAmtNqFaa1qq